import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react';

class App extends Component {
  constructor() {
    super();

    this.state = {
        monsters: [
         {
           name: 'Frankenstein',
           id: 'abc1'
         },
         {
          name: 'Dracula',
          id: 'abc2'
        },
        {
          name: 'Zombie',
          id: 'abc3'
        }
        ]
    };
  }

  render() {
  return (
    <div className="App">
      {this.state.monsters.map(monster => (
        <h1 key={monster.id}> {monster.name} </h1>
      ))}
    </div>
  );
  }
}

export default App;
